import React from 'react';
import swlogo from '../../assets/logo.svg';

export const Header = () => {
  return (
    <header className="flex text-center">
      <svg alt="star wars logo" src="{swlogo}" width="200px" height="100px" />
      <img src="https://fontmeme.com/permalink/200116/b0db4ffa47b7c1754a977d389ee99a76.png" />
    </header>
  );
};
